import React, { useEffect, useState } from "react";
import axios from "axios";

const LanguageTrends = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get("http://127.0.0.1:5000/analyze")
      .then(response => setData(response.data))
      .catch(error => console.error(error));
  }, []);

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">Top Languages by Usage</h1>
      <table className="min-w-full border-collapse border border-gray-300">
        <thead>
          <tr>
            <th className="border border-gray-300 px-4 py-2">Rank</th>
            <th className="border border-gray-300 px-4 py-2">Language</th>
            <th className="border border-gray-300 px-4 py-2">Trend Score</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              <td className="border border-gray-300 px-4 py-2">{index + 1}</td>
              <td className="border border-gray-300 px-4 py-2">{item.language}</td>
              <td className="border border-gray-300 px-4 py-2">{item.trend_score}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default LanguageTrends;
